import React from 'react'
import MaterialTable from "material-table"

function Table() {
const data=[
    {name:'Ramesh',age:12},
    {name:'Ramesh',age:13},
    {name:'Ramesh',age:14},
    {name:'Ramesh',age:16},
]
const columns=[
    {
        title:"Name",field:"name"
    },
    {
        title:"Age",field:"age"
    }
]



  return (
   <>
       <MaterialTable title="Material Table"
           data={data}
           columns={columns}
       />
   </>
  )
}

export default Table
